window.bookSummaryJSON = "<p>Cole Musgrave's dream of interstellar travel is about to become a nightmare. When a high-profile delivery is compromised aboard a state-of-the-art cargo vessel, the newly appointed captain finds himself embroiled in an assignment far above his pay grade. </p> <p>Blackmail, terrorists, a malfunctioning prototype A.I. pilot, and a sinister terraforming corporation with deep criminal ties await him. Who knew delivering cargo to the deep recesses of space could be so dangerous? </p> <p>Armed only with his cunning and past military experience, Cole is one against many. But this unorthodox interstellar cargo pilot won't go down without a fight - even after he is faced with a choice that will alter the course of his life forever. </p>"; 
